import React from "react";
import { useState } from "react";
const DogAgeCalculator = () => {
  const [age, SetAge] = useState(7);

  const dogAge = 7;

  return (
    <>
      <input
        type="number"
        value={dogAge}
        onChange={(e) => SetAge(e.target.value)}
        placeholder="USD"
      />
      <h3>{dogAge * age}</h3>
    </>
  );
};

export default DogAgeCalculator;
